import { useState, useEffect } from 'react';

/**
 * Debounces a value by the specified delay.
 * Useful for search inputs to avoid excessive API calls.
 */
export function useDebounce<T>(value: T, delay: number = 500): T {
  const [debouncedValue, setDebouncedValue] = useState<T>(value);

  useEffect(() => {
    const timer = setTimeout(() => setDebouncedValue(value), delay);
    return () => clearTimeout(timer);
  }, [value, delay]);

  return debouncedValue;
}

// Usage
const SearchComponent = () => {
  const [query, setQuery] = useState('');
  const debouncedQuery = useDebounce(query, 300);
  
  // Only triggers API call when user stops typing
  const { data } = useSearchQuery(debouncedQuery);
  
  return <input value={query} onChange={(e) => setQuery(e.target.value)} />;
};`}),n.jsxs("div",{className:"grid md:grid-cols-2 gap-8",children:[n.jsxs("div",{className:"p-6 rounded-2xl bg-emerald-500/5 border border-emerald-500/20 space-y-4",children:[n.jsx("h5",{className:"font-bold text-emerald-600",children:" useEffect Best Practices"}),n.jsxs("ul",{className:"text-sm text-muted-foreground space-y-2",children:[n.jsx("li",{children:" Always include dependencies"}),n.jsx("li",{children:" Clean up subscriptions & timers"}),n.jsx("li",{children:" Avoid async directly in useEffect"}),n.jsx("li",{children:" Split unrelated effects"})]}),n.jsx(Y,{language:"typescript",code:`//  Correct: Async wrapper function
